こちらのページでのご購入はクロネコヤマトのDM便でのお届けとなります。<br>
カード決済のみ受付。他の商品との同梱はできません。※DM便の商品は同梱可。<table border=0 width=100%><tbody><tr><td><table width=600 border=0><tr><td><font size=-1>※商品リニューアル等によりパッケージ及び容量等は変更となる場合があります。ご了承ください。</font></td></tr><tr><td align=left></td></tr><tr><td>&nbsp;</td></tr><tr><td><table width=100% border=0 cellpadding=5 cellspacing=1 bgcolor=#ff99ff><tr><td bgcolor=#ffccff width=70 align=center><font size=-1>商品説明</font></td><td align=left bgcolor=#ffffff><font size=-1>中高年からの健康管理に。特有成分モナコリンKを豊富に含む20倍濃縮の紅麹エキスを使用したサプリメントです。<br>食品の原材料として長い歴史を持つ紅麹。<br>沖縄・琉球王朝時代、紅麹を使用した醗酵食品「豆腐よう」は病後の滋養食として上流階級で珍重され、また、中国の古書「本草網目」には「消化を助け、血の巡りをよくし、内臓を強くする」効能のある漢方として記されています。<br>最近では、コレステロール値にはたらきかける成分モナコリンKを含む唯一の食品として注目を集めています。<br>●健康値が気になる方や、生活習慣リスクが気になる方、脂っこい食事が多い方に。<br>●夕食の後に摂るのがおすすめです。</font></td></tr><tr><td bgcolor=#ffccff width=70 align=center><font size=-1>召し上がり方</font></td><td align=left bgcolor=#ffffff><font size=-1>1日の目安量（1粒）を守り、水またはぬるま湯でお召し上がりください。</font></td></tr><tr><td bgcolor=#ffccff width=70 align=center><font size=-1>原材料</font></td><td align=left bgcolor=#ffffff><font size=-1>紅麹濃縮エキス末、オリーブ油/ゼラチン、グリセリン、ミツロウ、グリセリン脂肪酸エステル、レシチン（大豆由来）、カラメル色素</font></td></tr><tr><td bgcolor=#ffccff width=70 align=center><font size=-1>栄養成分</font></td><td align=left bgcolor=#ffffff><font size=-1>＜1日あたり：1粒600mg＞<br>熱量3.3kcal、たんぱく質0.17g、脂質0.21g、炭水化物0.18g、食塩相当量0.002g、紅麹濃縮エキス末180mg（モナコリンKとして2.7mg）</font></td></tr><tr><td bgcolor=#ffccff width=70 align=center><font size=-1>使用上の注意</font></td><td align=left bgcolor=#ffffff><font size=-1>●1日の目安量を守って、お召し上がりください。<br>●お身体に異常を感じた場合は、飲用を中止してください。<br>●原材料をご確認の上、食物アレルギーのある方はお召し上がりにならないでください。<br>●薬を服用中あるいは通院中の方、妊娠中の方は、お医者様にご相談の上お召し上がりください。<br>●健康食品は食品なので、基本的にはいつお召し上がりいただいてもかまいませんが、本品は夕食後にお召し上がりいただくことをおすすめします。<br>●直射日光、高温多湿な場所をさけて保存してください。<br>●お子様の手の届かないところで保管してください。<br>●開封後はしっかり開封口を閉め、なるべく早くお召し上がりください。<br>●食生活は、主食、主菜、副菜を基本に、食事のバランスを。</font></td></tr><tr><td bgcolor=#ffccff width=70 align=center><font size=-1>発売元、販売元又は製造元</font></td><td align=left bgcolor=#ffffff><font size=-1>株式会社ＤＨＣ</font></td></tr></table></td></tr><tr><td colspan=2 align=right><table border=0><tbody><tr><td valign=top align=middle><font size=-1>【広告文責】</font></td><td align=left><font size=-1>株式会社ザグザグ</font><br><font size=-1>（086-207-6300）</font></td></tr></tbody></table></td></tr><tr><td colspan=2>&nbsp;</td></tr></table></td></tr></tbody></table><style type="text/css">
